/* ICONS */
const iconFolder = "../images/icons/";

/* NavBar Icons */
const navBarIconFolder = `${iconFolder}navBarIcons/`;

export const HOME_BIG = `${navBarIconFolder}outline_home_white_24dp_2x.png`;
export const HOME_SMALL = `${navBarIconFolder}outline_home_white_24dp_1x.png`;
export const EXPLORE_BIG = `${navBarIconFolder}outline_tag_white_24dp_2x.png`;
