export const BOOKMARK_BIG = `${navBarIconFolder}outline_bookmark_border_white_24dp_2x.png`;
export const BOOKMARK_SMALL = `${navBarIconFolder}outline_bookmark_border_white_24dp_1x.png`;
export const LIST_BIG = `${navBarIconFolder}outline_list_alt_white_24dp_2x.png`;
export const LIST_SMALL = `${navBarIconFolder}outline_list_alt_white_24dp_1x.png`;
export const NOTIFICATIONS_BIG = `${navBarIconFolder}outline_notifications_white_24dp_2x.png`;
export const NOTIFICATIONS_SMALL = `${navBarIconFolder}outline_notifications_white_24dp_1x.png`;
export const PROFILE_BIG = `${navBarIconFolder}outline_profile_white_24dp_2x.png`;
